import Navbar from "./Navbar";
import Meme from "./Meme";
import MemeData from "./MemeData";

let memeElement = MemeData.map((meme) => (
  <Meme img = {MemeData.data.memes.url} />
));

// "http://i.imgflip.com/1bij.jpg"

export default function App() {
  return (
    <div className="app">
      <Navbar />
      {memeElement}
    </div>
  );
}
